        self.cljRefreshClassPathDirs(next);
      },
      function(next) {
        if (!options.all) return next();
        self.cljResetCljsAnalyzer(next);
      },
      function(next) { self.saveScheduleSelection(null, null, true, next) },

      options.data ? function(n) { n(); } : this.cljFindUnlistedNamespaces.bind(this),
      options.data ? function(n) { n(null, options.data); } : this.cljFetchNamespaceData.bind(this),
      this.updateNsList.bind(this),
      function(n) { self.scheduleSelection(selectedNs, selectedIntern, true, n) },
      function(n) {
        lively.lang.arr.mapAsyncSeries(options.namespaces || Object.keys(self.namespaceData), function(ea, _, n) {
          self.informOtherClojureBrowsersAboutChange(ea, null, n)
        }, function(err, _) { n(err); });
      }
    )(function(err) {
