function scheduleSelection(nsName, nsInternOrName, force, thenDo) {
  if (typeof force === "function") { // force == select even if current selection alread matches
    thenDo = force; force = false;
  }

  // init state
  var debug = false;
  var self = this;
  var nsList = self.get("nsList"), internList = self.get("nsInternList");

  self._scheduleSelectionQueue = self._scheduleSelectionQueue || (self._scheduleSelectionQueue = [])

  var nsIntern = nsInternOrName && nsInternOrName.name ? nsInternOrName.name : nsInternOrName
  if (!force && self.isSelected(nsName, nsIntern)) return typeof thenDo === "function" && thenDo();

  self._scheduleSelectionQueue.push([nsName,nsIntern,thenDo]);
  debug && show("scheduleSelection: %s %o", nsName, nsIntern);

  // if we are currently selecting, don't interfere
  if (self._selectionUpdateInProgress) return;

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-


  // we gather selection requests, those are reduced into a single actual
  // selection action

// self._selectionUpdateInProgress=false
  self._selectionUpdateInProgress = true;

  if (this.currentHistoryNavItem && this.recordNavigation) {
    this.currentHistoryNavItem.selection = this.get("CodeEditor").getSelectionRange()
    // show("recording %s %s", this.currentHistoryNavItem.selection[0], this.currentHistoryNavItem.selection[1]);

  }

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
  // and now the work begins...

  lively.lang.fun.debounceNamed(self.id + "-scheduleSelection", 100, function() {
    var endActions = lively.lang.fun.either(
      function timeout() { step6_RunCallbacksAndCleanup(new Error('timeout!')); },
      function normalend(err, selSpec) { step6_RunCallbacksAndCleanup(err, selSpec); });

    lively.lang.fun.composeAsync(
        step1_retrieveSelectionSpec,
        step1_updateTitle,
        step2_nsListSelection,
        step3_initUpdateNsInternList,
        step4_initUpdateSourceView,
        step5_recordNavigation
      )(endActions[1]);

    setTimeout(endActions[0], 30*1000);
  })();

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
  // tasks below
  // -=-=-=-=-=-=-=-

  function step1_retrieveSelectionSpec(next) {
    var last = self._scheduleSelectionQueue.last();
    self._scheduleSelectionQueue = self._scheduleSelectionQueue.slice(-1);

    var selSpec = {nsName: last ? last[0] : null, nsIntern: last ? last[1] : null}
    debug && show(selSpec);
    next(null, selSpec);
  }

  function step1_updateTitle(selSpec, next) {
    var title = selSpec.nsName ? (selSpec.nsName + (selSpec.nsIntern ? "/" + selSpec.nsIntern : "")) : "";
    self.getWindow().setTitle("ClojureScript Browser " + title);
    next(null, selSpec);
  }

  function step2_nsListSelection(selSpec, next) {
    // debug && show("scheduleSelection: %s %o", selSpec.nsName === nsList.selection);
    if (!selSpec.nsName) selSpec.nsIntern = null;
    var q = self._scheduleSelectionQueue.clone();
    nsList.selection = selSpec.nsName;
    nsList.scrollIndexIntoView(nsList.selectedLineNo);
    self._scheduleSelectionQueue = q;
    next(null, selSpec);
  }

  function step3_initUpdateNsInternList(selSpec, next) {
    if (selSpec.nsName) self.updateNsInternList(function(err) { next(err, selSpec); });
    else next(null, selSpec);
  }

  function step4_initUpdateSourceView(selSpec, next) {
    if (!selSpec.nsName) nsList.deselectAll();

    var q = self._scheduleSelectionQueue.clone();
    if (!selSpec.nsName || !selSpec.nsIntern) internList.deselectAll();
    else {
      internList.setSelectionMatching(
      new RegExp("^" + selSpec.nsIntern
          .replace(/\*/g, "\\*").replace(/\?/g, "\\?")
        + "( \\(private\\))?$"));
      internList.scrollIndexIntoView(internList.selectedLineNo);
    }
    self._scheduleSelectionQueue = q;

    if (!selSpec.nsName && !selSpec.nsIntern) {
      self.get("CodeEditor").setNewContent("");
      self.get("metadataEditor").textString = "";
      return next(null, selSpec);
    } 

    lively.lang.fun.waitForAll([
      function(next) {
        if (selSpec.nsName && !selSpec.nsIntern) self.updateNamespaceSource(next);
        else next();
      },
      function(next) {
        if (selSpec.nsName && selSpec.nsIntern) {
          var nsData = self.namespaceData[selSpec.nsName] || {},
              intern = (nsData.interns || []).detect(function(ea) {
                return ea.name === selSpec.nsIntern; });
          if (!intern) next(new Error("Could not find data for " + selSpec.nsName + "/" + selSpec.nsIntern));
          else self.updateWithNsInternData(intern, function(err) { next(err); });
        } else next();
      }
    ], function(err) { next(err, selSpec); })
  }

  function step5_recordNavigation(selSpec, next) { self.historyRecordNavigation(); next(null, selSpec); }

  function step6_RunCallbacksAndCleanup(err, selSpec) {
    if (err) self.get("CodeEditor").setStatusMessage(String(err).truncate(600));
    self._selectionUpdateInProgress = false;
    var q = self._scheduleSelectionQueue;
    self._scheduleSelectionQueue = [];

    selSpec && q.forEach(function(ea) {
      if (ea[0] != selSpec.nsName || ea[1] != selSpec.nsIntern
       || typeof ea[2] !== "function") return;
      try { ea[2](err); } catch (e) { show(String(e)); }
    });

    var last = q.pop();
    var selectAgain = last && selSpec && (selSpec.nsName != last[0] || selSpec.nsIntern != last[1]);

    if (selectAgain) return self.scheduleSelection(last[0], last[1], last[2]);
  }

}

