function onExternalChangeNs(change, thenDo) {
  var intern = this.get("nsInternList").selection;
  if (!this.namespaceData[change.ns] && !change.data) return thenDo && thenDo();
  if (!change.data) delete this.namespaceData[change.ns];
  else this.namespaceData[change.ns] = lively.lang.obj.deepCopy(change.data);

  var self = this;
  lively.lang.fun.debounceNamed(this.id+"onExternalChangeNs", 100, function() {
    lively.lang.fun.composeAsync(
      self.updateNsList.bind(self, self.namespaceData),
      function(n) {
        if (!self.isSelectedNs(change.ns)) return n();
        if (!self.get("CodeEditor").hasUnsavedChanges()) {
          self.scheduleSelection(
            change.data ? change.ns : null,
            change.data && intern ? intern.name || intern : null,
            true, n);
        }
      }
    )(thenDo);
  })();
}

