function loadProjectInteractively() {

  var cwd = lively.shell.exec('pwd', {sync:true}).resultString();    
  var e = this.get("CodeEditor"), dir, self = this, report;
  var indicatorClose;

  lively.morphic.tools.LoadingIndicator.open("loading project", 
    function(close) { indicatorClose = close; });

  lively.lang.fun.composeAsync(
    deselect,
    Global.clojure.Projects.loadProjectInteractively.curry(
      {showWarningFn: function(warnings) { e.setStatusMessage(warnings); },
       askToLoadNamespaces: true, setCurrentDir: true, informBrowsers: true}),
    select
  )(function(err, loadResult) {
    indicatorClose && indicatorClose();
    (function() {
      if (err) self.showClojureError(err, "Error loading project" + (loadResult && loadResult.dir ? " " + loadResult.dir : ""));
      else e.setStatusMessage(report || "Successfully loaded project " + loadResult.dir)
    }).delay(0.2);
  })

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function deselect(n) {
    self.saveScheduleSelection(null,null,true, n)
  }

  function select(loadResult, n) {
    if (!loadResult.cljsNamespaces.length) return n(null, loadResult);
    (function() {
      self.scheduleSelection(loadResult.cljsNamespaces[0], null, true);
      n(null, loadResult);
    }).delay(.2);
  }
}

